function ConfirmClick(n,t){n.preventDefault();$("#confirmDialog").dialog({autoOpen:!1,modal:!0,resizable:!1,buttons:{Confirm:function(){t()},Cancel:function(){$(this).dialog("close")}}});$("#confirmDialog").dialog("open")}function ConfirmClickGeneric(n,t,i=300){$(t).dialog({autoOpen:!1,modal:!0,resizable:!1,width:i,buttons:{Confirm:function(){n()},Cancel:function(){$(this).dialog("close")}}});$(t).dialog("open")}